import React from 'react';
import TopNavbar from './components/TopNavbar';
import BottomNavbar from './components/BottomNavbar';
import Content from './components/Content';
import Footer from './components/Footer';
import SignUpForm from './components/SignUpForm';
import Grid from '@material-ui/core/Grid';

const Landing = () => {
	return (
		<div className='landing-container'>
			<TopNavbar />
			<BottomNavbar />
			<Container>
				<Grid container direction='row-reverse' justify='center' alignItems='center' style={{ height: '77vh' }}>
					<Grid item style={{ direction: 'rtl', marginLeft: 40 }}>
						<h1 className='landing-content-heading'>تایپ آنلاین، به‌صرفه!</h1>
						<p className='landing-content-paragraph'>
							تیزتایپ همواره در تلاش است تا بهترین تجربه‌ی سفارش، انجام و تحویل پروژه‌های تایپ بصورت آنلاین را برای شما
							به ارمغان بیاورد.
						</p>
					</Grid>
					<Grid item>
						<SignUpForm />
					</Grid>
				</Grid>
			</Container>
			<Content />
			<Footer />
		</div>
	);
};

export default Landing;
